
"use strict";app.controller("SigninFormController",["$scope","$http","$state",function(a,c,b){a.user={};a.authError=null;a.login=function(){a.authError=null;c.post(BASEURL+"login/submit",{email:a.user.email,password:a.user.password}).then(function(d){switch(d.data.STATUS){case 101:a.authError=d.data.MSG;break;case 200:window.location.reload();break}},function(d){a.authError="Server Error"})}}]);